    [],nt"revision_timestamp": "2016-07-27T22:38:48.989408",nt"name": "narrative-report-lake-andes-national-wildlife-refuge-may-1-august-31-1958",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Lake Andes NWR
    outlines Refuge accomplishments from May through August of 1958. The report begins
    by summarizing the weather conditions, habitat conditions, water conditions, and
    food and cover during this period. Wildlife- including migratory birds, upland game
    birds, big game animals, furbearers, predators, rodents, mammals, raptors, fish,
    reptiles, and disease- is also covered. The Refuge development and maintenance section
    discusses physical developments, vegetation control, and wildfires. Resource management
    is outlined; topics include grazing. A progress report on field investigations and
    applied research is also provided. The public relations section of the report describes
    recreational uses, Refuge visitors, and Refuge participation. Items of interest
    and N-R forms are attached.",nt"license_title": "License Not Specified",nt"extras":
